INSERT INTO `cmrempdata` (`cmrEmpData_id`, `cmremp_id`, `date`, `content`, `note`) VALUES
(1, 7, '0000-00-00', 'asdasd', 'asdasd'),
(2, 0, '2019-04-18', 'asdqwwqe', 'asd'),
(13, 54, '2019-04-28', 'My staff is having a difficulty in balancing her time in coping up with demands of her work and the deadline of the Barangay Annual Budget because of the following: \n\na.  Annual Budgets of the barangay are not submitted on time\nb.  The barangay secretaries didn\'t keep track of their records\nc.  The barangay secretaries and treasurers needs to enhance further their knowledge in formulating an ordinance and resolution', 'Conduct seminar to all barangay secretaries and treasurers in how to formulate an ordinance and resolution.  Inform the barangay to keep track of their records.  And set an earlier schedule regarding the deadline of the Barangay Annual Budget.'),
(14, 55, '2016-04-27', 'Problems encountered in relation to Annual Budget preparation.  What are presently done? What are her suggestions to address the problems.', 'Completion of the preparation of Annual Budget maybe affected because of the delay of some departments / offices in submitting their budget proposals.\n\nRecommendation / Commitment:\n*  include submission of budget proposals in the preparation of DPCR as core function\n*  encourage departments / offices to submit budget proposals on time\n*  constant follow - up of department / offices on the submission of their budget proposals.'),
(15, 56, '2016-05-02', 'Employee is new to the job and her rating on quality of MFO.  Prepare monthly remittance report and DV of amount due to Pag-ibig is not consistently high.  One of the concern raised during coaching is the occurrence of discrepancy when another staff who did not know of the pre-agreed control measure takes over.', 'The person acknowledges that this happened because she did not discuss with the person concerned the cause of discrepancy and how to preclude similar occurrence in the future.  She resolved to talked with the person concerned her findings and suggestions on how to prevent the same in the future'),
(16, 57, '2016-04-28', 'As frontline personnel, one must be able to properly direct clients for the needed appraisal and assessments services requested with satisfaction.', 'Ms. Anita Pael, committed herself to properly informed clients as to needed requirements in processing appraisal and assessment transaction and refer immediately matters that needs decision by the City Assessor or LACO IV.'),
(17, 58, '2016-04-29', 'Some problems and difficulties encountered in Monitoring of Collection of Real Property Tax Collection for the year 2016.', 'Weakness Collection\n\nShe suggested that Brgy. Officials would help in the collection of taxes by encouraging constituents to pay taxes promptly thru a barangay ordinance requiring tax clearance before issuance of a barangay clearance.  She initiated Tax Collection of fiesta day, for constituents influx to barangay center during fiesta time.\n\nFor her, it is better that there will be additional personnel for Real Property Tax assessment / demand letters distribution.  She suggested that a 2 day follow-up field collection per week for every collector be strongly implemented as a Standard Operating Procedure.  She suggested to swap one male employee from Public Market Section to be assigned as RPT collector.  \n\nNote:  Potential to be given an incentive award for being best performing employee if target will be meet.'),
(18, 59, '2016-04-29', 'Employee observed that clients consume more time in securing needed documents to avail of the medical assistance especially when their needed medicines exceed to P 1,000.00', 'Employee suggested that there must be a checklist (containing the procedure and requirements), so that clients will be guided and to maximize time.'),
(19, 60, '2016-04-27', 'The subject of discussion was the designation of the coachee as Pollution Control Officer (PCO).  Main concern of the coach was the capability of the coachee to perform the expected task of a PCO given that he is still undergoing training and orientation and how will it affect his current responsibility as head of UEM division.  In addition, the coachee is frequently requested to act as emcee in various LGU gatherings but the coachee did not see it as additional load, instead it gave him positive emotional effects which in some ways \"energized\" him.  Coachee has mentioned other extra load like membership to LGU committees and TWGs but unfortunately, the coach failed to take these into further discussion.', 'The coach has not mentioned specific observation on areas for improvement rather it was more  of eliciting the coachee\'s self assessment of his current and additional working load.  The coachee committed to do his best and was optimistic he can handle the additional load provided he completes the training to be provided and he can readily access assistance from other City ENRO personnel in the performance of his core function.  The coach also committed to support his training needs as well as the assistance of other City ENRO personnel'),
(20, 61, '2016-04-29', 'Updated material specifications with their corresponding unit price to be used in our various Program of Works prepared.', 'To schedule a date together with all Programmers in the inquiry of materials specification and unit costs to various suppliers outside Bayawan City.'),
(21, 62, '2016-05-02', '*  OPD protocol not followed sometimes\n\n*  Frequent absenteeism of redial staff would jeopardize schedule', '*  Refering RAMS must follow protocol (will be discussed your duty)\n\n*  Review on budgeting allocation and make supplemental if possible\n\n*  Will make a written evaluation and submit to HR regarding frequent absenteeism of staff for disciplinary action.\n\n*  Conduct NO NOON BREAK policy for OPD clients'),
(22, 63, '2016-04-28', 'Employee is complained of by the CTO for passing 3 times inaccurate payroll which led to the delay in releasing salaries of CPSO employees.', 'She acknowledges her lapses and committed that before she will submit the payroll she will review it with due care ad will inform the concerned agencies if some employees of the office are absent from work within the pay period.'),
(23, 64, '2016-04-29', 'She is having hard time in answering queries pertaining to cooperative laws.  Though she have attended few seminars and trainings but still her capacity wasn\'t good for her.', 'She is committed to study deeper further the cooperative law.  Familiarize coops that are thriving in the city and even learn their history and current status.'),
(24, 65, '2016-05-02', 'Target on number of dairy animals monitored as to health status - it is done monthly but not reflected on the report, veterinary service given should be reflected in the report.', 'Vaccination record should be reflected on the monitoring report.'),
(25, 66, '2016-07-11', 'The employee has just taken over all the tasks left by the deceased employee.  Including the unprocessed and unfinished documents.  On the other hand, employee is also processing new applicants for birth registration.', 'The employee is fast learning the process.  Once in a while refers legal matters affecting the process, to the department head.'),
(26, 68, '2016-07-20', 'Deficiency in collection especially in the Slaughterhouse (abattoir) and the Paonay areas.', 'Measures being done was to look into the rates of the slaughterhouse fees as per stated in the LRC of 2007 in relation to the rates in the Omnibus Market Code of 1993 and applying whichever is higher.  \n\nNote:  The Local Revenue Code of 2007 does not supersede the Omnibus Market Code of 1993.\n\nPersons engaged in Pig roasting were requested to have their pigs slaughtered in the slaughter house and will be inspected daily of their supply.  In the paonay area, we inspected the different areas for exact measurements and for proper assessment.  We asked for assistance from the Market personnel for proper implementation of the new rates.  To keep the personnel properly motivated, constant monitoring and acknowledgement on their work for a job well done.\n\nRecommendation :  To hire employees / workers that are honest and hardworking with good initiative in performing their daily task.'),
(27, 69, '2016-08-18', 'She shows competence in her assignment being the focal person Program.  She even find time to spend extra mile in order to have a greater and quality time with the recipients of the scholarship.  Aside from that, she also functions as focal for the TESDA STEP Program, SRA concerns and assist in DOLE and Coop Program implementation.', 'Found to be committed in the tasks assigned to her and shows interest to learn more to improve herself.  Thus, I highly recommend that she attend more meetings, trainings, and seminars to further develop her potentials.'),
(28, 70, '2017-10-27', 'Problems encountered as my first time in the Budget Preparation Section.\n\n*  Barangay Review - What to do so I can review the barangay budget accurately and on time?\n\n*  Barangay Referral and Indorsement - How to respond barangay referrals and indorsement accurately and on time?\n\n*  Budget Preparation - The right procedure in preparing the budget?\n\n*  Coordination with the other sections in the budget office', 'Checking the barangay budget maybe delayed due to some errors / lack of signatures of the barangay concerned.\n\nRecommendation / Commitment:\n-  Get their directory / phone numbers\n-  Read IRR concerning the barangay issues\n-  Mastery of the barangay budget preparations, requirements & etc. (Barangay Budget Operation Manual)\n\nResponding the requests on time maybe delayed due to my lack of knowledge.\n\nRecommendation / Commitment:\n-  Getting help from co-workers who previously done the work.\n-  To get more knowledge of the budget cycle by reading available materials.\n-  I must read current circulars / memorandum.\n\nWorking as assistant to the section head must not wait for work to be given.\n\nRecommendation / Commitment:\n-  I must know the budget forms needed in the budget preparation.\n-  I must read the latest manual to help me prepare the budget.\n-  Getting help from co-workers who previously done the work.\n\nAs I already worked in the allotment section, obligation section and now in the budget preparation I need more knowledge to relate all the budget process and function in 3 sections.'),
(29, 71, '2017-10-26', 'Focus on IEC activities', 'monitor targets'),
(30, 72, '2017-01-30', 'SPES payment from DOLE were efficiently facilitated with dispatch.', '- The concern staff made immediate notice to SPES students to come on the scheduled pay day.\n-  Made efforts to properly process all needed documents.\n-  It was suggested to make interaction with students to be friendly and amiable to consider their plights.'),
(31, 73, '2018-05-16', 'Problems encountered during filing of documents in the City Budget Office\n\n*  Increase volume of documents to be filed', '*  Report during Saturday / Holidays just to cope up filing\n*  Take advantage of time for filing when the City Budget Officer in out of office for official business'),
(32, 74, '2018-05-23', '*  How to accomplish work on time, especially sorting of voucher\n*  How to prevent erroneous report\n*  How to cope up with the newly implemented system (eNGAS v. 2.0)\n*  Relationship towards coworkers.', '*  Whenever there\'s no accountant\'s advice or Tax Certificate to be prepared, use that time to sort vouchers; balance your work and set targets.\n*  Double check and always review your output before finalizing it.  If there\'s confusion or something you are uncertain of, refer to someone who\'s more knowledgeable about it.\n*  Study and familiarize the system; try to explore the tool and identify its functions.\n*  Each of us may have differences but always put in mind that we are family.  No matter what happens, we can always have each other\'s back.'),
(33, 75, '2018-06-19', 'List of materials for the semen processing room had not been completed', 'Finalization of the list of materials as soon as possible not later than June 29, 2018.'),
(34, 76, '2018-04-24', 'Steps in issuing Documentary Stamp Tax and process in the remittance of DST collection to BIR', '3 collectors assigned and will have a separate logbook to be used in the recording of issuance of Documentary Stamp Tax (DST) for remittance to BIR.  Sarita Alicia N. Asparen volunteered to be in charge in the consolidation and preparation of reports.'),
(35, 77, '2018-04-24', 'Steps in issuing Documentary Stamp Tax and Process in the remittance of DST Collection to BIR', '3 Collectors assigned and will have a separate logbook to be used in the recording of issuance of Documentary Stamp Tax (DST) for remittance to BIR.  Sarita Alicia N. Asparen volunteered to be in charge in the consolidation and preparation of reports.'),
(36, 78, '2018-04-24', 'Steps in issuing Documentary Stamp Tax and Process in the remittance of DST Collection to BIR.', '3 Collectors assigned and will have a separate logbook to be used in the recording of issuance of Documentary Stamp Tax (DST) for remittance to BIR.  Sarita Alicia N. Asparen volunteered to be in charge in the consolidation and preparation of reports.'),
(37, 79, '2018-04-24', 'Steps in issuing Documentary Stamp Tax and Process in the remittance of DST Collection to BIR.', '3 Collectors assigned and will have a separate logbook to be used in the recording of issuance of Documentary Stamp Tax (DST) for remittance to BIR.  Sarita Alicia N. Asparen volunteered to be in charge in the consolidation and preparation of reports.'),
(38, 80, '2018-01-15', 'The subject of discussion was on how to monitor the daily activities of the field personnel of FFM division considering its spatial distribution and expanding barangay coverage.  To date, there are 37 field personnel composed of 5 casual, and 32 Job Order workers distributed in 19 upland barangays.  Although there are designated cluster supervisors handling each of the 5 clusters of barangays, it is impossible to closely monitor all the personnel under each supervisors since most of the time the personnel are in the field thus personal contact is very limited.  Punctuality and actual daily attendance are difficult to personnaly monitor.\n\nVarious strategies were proposed, deliberated and assessed based on applicability  aand potential effectiveness.  Prioritized strategies for immediate implementation are listed in next column under comment and commitment.', '*  Strengthen the monthly reporting of accomplishment of each field team / barangay.\n\n*  Require each personnel to submit every quincena list of activities performed every working day and indicate the actual output per day.\n\n*  Personnel residing in the barangay are required to sign in the logbook of the barangay everytime they report to work.'),
(39, 81, '2018-02-15', 'There are reports that one of the designated Leadman under the coachee is no longer performing his usual task and is not monitoring the day to day activities of personnel under him.  There are even reports that he frequently roam around outside of the working area and sometimes seen playing in billiard hall.  The coachee brought the matter to the coach who told him, why not we call the attention of that Leadman so we can verity the validity of said report.  The coachee explaine that he is hesitant to do it because there is no solid proof yet to pin down him.  The coach ask him what is your alternative option to prove it or at least stop the reported malpractice.  The coachee suggested to transfer the working assignment of said Leadman where his function would require him to stay whole day in the workplace.', 'The coachee\'s suggestion was carried on the condition that he would closely monitor the attendance and performance of the Leadman.\n\nOm the meantime that a replacement Leadman is still to be inducted and trained to his functions, the Section head will temporarily handle the function of the transferred Leadman.'),
(40, 82, '2018-05-17', 'The coachee having a poor command in English which hinders him to give a concise report.', 'I as a coach noted his problem and in fact observed it first hand that the reports he is submitting to the office is not of quality because grammar wise it is too confusing and even some of his spellings are wrong.\n\nSo I asked him in what way the office can help.  He specifically requested for a Basic English Tutorial and Technical Writing class.'),
(41, 83, '2018-05-16', '*  Format and writing style on L2BAA resolutions and minutes.\n\n*  Agreement on period of preparation and submission', '*  For continuous follow up concerning issues.\n\n*  Training intervention on technical writing.'),
(42, 84, '2018-04-25', 'Direct clients / customer for the needed appraisal and assessment service requested with satisfaction.', 'Coachee committed herself to properly informed and assist clients / customer needed requirements in various services requested in appraisal and assessment and refer immediately matters that needs decision by the City Assessor or by the Local Assessment Operation Officer IV'),
(43, 85, '2018-01-19', 'As expediter she practice a biblical record keeping of her document which sometime result add measure to her work.', 'Commit to practice a good keeping of her records and documents for a smooth flow of her work.'),
(44, 86, '2018-01-31', '*  Facilitate Business One Stop Shop (BOSS)\n*  Conduct monthly price monitoring on basic and prime commodities.\n*  Facilitate Business Trade Name new and renew registration.', '*  Accomplished all assigned tasks without difficulty in time.'),
(45, 87, '2018-01-26', 'Preparation of VAC Revalida Handout and presentation, Follow up documents of KALIPI Maninihon and RIC Palongpong.\n      -  having a hard time in consolidating and experience pressure in meeting the deadline.', 'Committed to overcome the pressure when meeting deadlines and to have enough patience to follow up necessary documents.'),
(46, 88, '2018-01-19', 'She is active and tries to accomplish with all he best to her assigned tasks as back-up staff in the livelihood activities of the office and inspite of her limited knowledge she is coping to learn to work it out.', 'She is committed to familiarize all her assigned tasks just to accomplish what is expected.'),
(47, 89, '2018-01-17', 'She assists the Department Head in directing, supervising and coordinating the operations and activities of the department to strengthen various programs and projects by strategizing  plans and reports to be implemented aside from being the focal person of the LGU Scholarship Program.', 'Her performance of every task assigned to her is always with exemplary dedication and commitment to achieve excellence in all aspects of the job.'),
(48, 90, '2018-01-15', '*  Beating deadlines (consolidated reports; annual accomplishment, IPCRs / OPCRs, attendance report, etc.)\n    -   sometimes, has the tendency of cramming when beating deadlines but delivers what are supposed to be accomplished at a given time.', 'She is committed to focus on a given task but will also consider the time allotted to it. She will prepare herself working under pressure and will not stress out.'),
(49, 91, '2018-01-11', 'Facilitated immediate repatriation of OWWA welfare case; urgent reply from OWWA 7 needed to avail the amnesty report program of the government.  Has difficulty in the communications and Emails and immediate reply.', 'Committed to take action with OWWA 7 and other involved agencies to call the attention of POLO embassy for his immediate return to PH.'),
(50, 92, '2018-01-09', 'She assist in the implementation of the community based skills training program.  Aside from that she also functions as focal person of the TESDA TUSP program and assist in the conduct of assessment / trade test classes.  Inspite of the difficulty in the communications still able to handle it on time.', 'Committed to accomplish all the necessary documents to finish ahead of scheduled classes.'),
(51, 93, '2018-01-15', 'Assist and conduct in organizing association for registration with DOLE.', 'Give time and effort to his assigned task.'),
(52, 94, '2018-01-10', 'She is capable of accomplishing her assigned tasks as support for DTI programs and services despite of the volume and as computer operator to various office paper works.', 'She is committed to do her best to improve her capabilities and interested to learn more when their is opportunity.'),
(53, 95, '2019-07-23', '*Designated as a reliever in reviewing, checking all supporting documents of all incoming obligation request when our section head is not available that resulted to the delay in controlling obligations for department / offices that were assigned to me.\n\n*  Committing errors in controlling obligations.\n\n*  Other things to learn in the office.', '*  Request my co-workers to control OBRs for transactions that were assigned to me.\n\n*  Be careful and full concentration on the task assigned.\n\n*  Be aware of the updates whatever related issues and concerns in the office.'),
(54, 96, '2019-07-24', '*  Preparation and processing\n\n*  Supervision of personnel', '*  Train existing personnel\n\n*  Equipment Support\n\n*  Review structure and set-up of personnel\n\n*  Study assignments and individual targets.'),
(55, 97, '2019-07-24', '*  Technical capacity of personnel\n\n*  Marketing\n\n*  Events (Innovation)\n    -  Brand Commemoration\n    -  Race\n    -  Bahandi Caravan\n    -  Film / Music Competition', '*  Templates, checklist\n\n*  Having the right people\n\n*  Tourist Map-out source\n\n*  Tourist Info (web-base)\n\n*  Ibayaw Tours for students\n\n*  Inter-office operation'),
(56, 98, '2019-07-24', '*  Administrative Services\n\n*  Proposal Making', '*  Shadowing\n\n*  Buddy System\n\n*  Training\n    -  Basic Communication\n    -  Computer Lit\n\n*  Hiring of Technical Person (Immediate Need)\n   -  FS\n   -  Business Plan\n\n*  Formalization of Office Plantilla\n\n*  Out source\n\n*  Partnership with academe\n   -  Business Forum');
