INSERT INTO `ldpinhousetrainings` (`ldpinhousetrainings_id`, `ldplan_id`, `training_id`, `goal`, `numHours`, `participants`, `activities`, `evaluation`, `frequency`, `budgetReq`, `partner`) VALUES
(1, 1, 51, 'Equip employees with tools and techniques in providing good customer service to the public; Improve appreciation on the importance of quality customer service in government.', 16, 'Frontline Service Providers', 'Lecture, workshop, group dynamics', 'Result of written test\nActual application On-the-Job Observation\nEvaluation Forms', 'Year-round (As often as necessary)', '30,000.00 per session', 'LGU-Bayawan City/HRMO'),
(2, 1, 62, 'Build spirit of teamwork that will breathe life and creativity into the organization/department; Increase appreciation of working together as a team in achieving organizational goals and objectives.', 16, 'Employees by department/section/ team', 'Facilitated group discussion, workshop, group dynamics', 'On-the-Job Observation\nEvaluation forms\n', 'Year-round (As often as requested)', '30,000.00 per session', 'Employees by department/section/ team'),
(3, 1, 49, 'Explain what strategic planning is all about and how to implement an effective process in order to create an effective strategic plan; Identify procedures to properly communicate strategic planning ideas; Set goals and expectations for each section of the department.', 16, 'Employees by department/section/ team', 'Lecture, facilitated group discussion, workshop, group dynamics', '- Result of written test\n- Evaluation forms\n', 'Year-round (As often as requested)', '30,000.00 per session', 'Employees by department/section/ team'),
(4, 1, 63, 'Increase knowledge on rights, privileges, duties as public servants', 8, 'Newly hired employees (permanent and casual)', 'Lecture, workshop, group dynamics', 'Result of written test\nEvaluation forms\n', 'Year-round (As often as necessary)', '15,000.00 per session', 'Newly hired employees (permanent and casual)');
