INSERT INTO `ldplgusponsoredtrainings` (`ldplgusponsoredtrainings_id`, `ldplan_id`, `training_id`, `goal`, `numHours`, `participants`, `activities`, `evaluation`, `frequency`, `budgetReq`, `partner`) VALUES
(1, 2, 64, 'Improve team performance by sharpening their own leadership team development skills; Empowers managers/supervisors become an engaging leader that creates confident, inspired, empowered, and enthusiastic teams! ', 24, 'Department/Section Heads and acting supervisors', 'Lecture, facilitated group discussion, workshop, group dynamics', 'Actual application\nOn-the-Job  Observation\nEvaluation forms\n', 'Semi-Annually', '180,000.00 x 2\n\n360,000.00', 'Open to any LSP'),
(2, 2, 65, 'Increase leadership effectiveness and team\'s performance by cultivating an environment of enthusiasm and commitment; Learn basic concepts and skills in applying the strengths-based approach to developing and enhancing employee engagement in organizations.', 16, 'Managers/supervisors and other high potential employees preparing for supervisory roles', 'Lecture, workshop, group dynamics', '- On-the-Job Observation\n- Evaluation forms\n', 'Semi-Annually', '70,000.00 x 2\n\n140,000.00', 'Open to any LSP\n\n'),
(3, 2, 66, 'Develop the knowledge, attitude, and skills to formulate ideas and solutions to problems and increase motivation, job satisfaction and engagement;', 16, 'All employees', 'Lecture, workshop, group dynamics', '- On-the-Job Observation\n- Evaluation forms\n', 'Semi-Annually', '70,000.00 x 2\n\n140,000.00', 'Open to any LSP'),
(4, 2, 67, 'Empower members of the team (who do the work) to eliminate waste and reduce the burden of work in order to improve the quality and efficiency of service delivery.', 8, 'All employees', 'Lecture, facilitated group discussion, workshop', '- Process Improvement Plan\n- On-the-Job  Observation\n- Evaluation forms\n', 'Semi-Annually', '35,000.00 x 2\n\n70,000.00', 'Open to any LSP'),
(5, 2, 68, 'Define what personal financial management is all about; Determine the structure of a sound financial plan; Help employees commit to financial goals and plan how to get to it', 16, 'All employees', 'Lecture, workshop, ', '- Result of written exam\n- Evaluation forms\n', 'Annually', '70,000.00', 'Open to any LSP'),
(6, 2, 69, 'Learn structured tools and techniques to identify problems, their likely causes, and to propose solutions that will solve the problem and prevent it from recurring. ', 16, 'All employees', 'Lecture, facilitated group discussion', '- Actual application\n- On-the-Job Observation\n- Evaluation forms\n', 'Annually', '70,000.00', 'Open to any LSP'),
(7, 2, 70, 'To upgrade professional writing skills, from the usual business written communication (i.e. letters, memos, e-mails) to more highly specialized documents (i.e. proposals, reports, policies & procedures); Evaluate effective technical writing in terms of clarity, conciseness, accessibility, accuracy, and audience awareness', 16, 'Clerks, Administrative Officers, Supervisors whose work involves the preparation of high technical and specialized documents such as proposals, reports, instruction manuals, and the like', 'Lecture, workshop, group dynamics', '- Actual application\n- On-the-Job Observation\n- Evaluation forms\n', 'Annually', '70,000.00', 'Open to any LSP'),
(8, 2, 71, 'These 7 Habits of Highly Effective People are at the heart of team, organizational, and personal effectiveness. This will help supervisors to effectively lead yourself, influence, engage, and collaborate with others- and continuously improve and renew your capabilities.', 16, 'All employees', 'Lecture, workshop, group dynamics', '- Actual application\n- On-the-Job Observation\n- Evaluation forms\n', 'Annually', '70,000.00', 'Open to any LSP'),
(9, 2, 41, 'To develop core leadership skills, knowledge, and behaviours to enable  your supervisors to effectively manage and lead a team and help them achieve vision and objectives of the organization.', 0, 'Department Heads and Supervisors', 'Lecture, facilitated group discussion, skill building sessions', '- Actual application\n- On-the-Job Observation\n- Evaluation forms\n', 'Annually', '500,000.00', 'Open to any LSP');
